description:
This Bible commentary on the book of James was written by T.O.D. Johnston and published online by Owen Johnston. The commentary is based on Bible study lessons on the Epistles of Paul to the Corinthians that T.O.D. taught at Paran Baptist Church (located at 1603 Johnsonville Highway, Lake City, South Carolina).
